function Navbar() {
    return (
     <div className="navbar__nav">
        <div>
            <img src="BrainFlix-logo.svg"></img>
            <h3 className="navbar__header">BrainFlix</h3>
        </div>

        <div>
           <input type="text" placeholder= "Search..." ></input>
